Text:
The time has come for all right-thinking nations to join hands to completely eradicate terrorist networks.

Only by doing so,

Can we replace hate with harmony; 

Destruction with development &amp; 

Transform the landscape of violence and vendetta into a postcard for peace: PM

Who would know better than all of you here about the challenges the country was facing during 2013-14;

inflation was breaking the back of every house-hold,

Increasing current account deficit &amp; higher fiscal deficit were threatening  macro-economic stability of the country: PM

The country was facing total policy paralysis. This was preventing the economy from reaching the level which it was worthy of;

The global fraternity was worried about health of this member of fragile five club.

There was a perception of surrender to existing circumstances: PM

We have moved away from the A,B,C mentality

A for avoiding, B for burying and C for confusing

Instead of avoiding, we dealt with the issue;

Instead of burying it, we dug it out &amp; communicated to the people;

Instead of confusing the system, we showed a solution is possible: PM

A novel effort that will help several Indians! 

